lly attract, recruit and retain students. &lt;/b&gt;\n&lt;br&gt;\n&lt;br&gt;\n\n&lt;/font size=''&gt;\n","width":3000},"id":"1160","type":"Div"},{"attributes":{},"id":"1172","type":"AllLabels"},{"attributes":{"fill_color":{"value":"red"},"line_color":{"value":"red"},"marker":{"value":"square"},"size":{"value":8},"x":{"field":"longitude"},"y":{"field":"latitude"}},"id":"1126","type":"Scatter"},{"attributes":{"fill_alpha":0.5,"fill_color":"lightgrey","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"syncable":false,"xs_units":"screen","ys_units":"screen"},"id":"1070","type":"PolyAnnotation"},{"attributes":{"booleans":[true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true,true]},"id":"1102","type":"BooleanFilter"},{"attributes":{},"id":"1149","type":"StringEditor"},{"attributes":{"data":{"GEOID10":["040134226464008","040134226461041","040134226461046","040138176001113","040138172001003","040138172001008","040138172001033","040138172003034","040138171003008","040138169001072","040138170001019","040138172001049","040138176001039","040138176001086","040134226463017","040134226461060","040134226464024","040134226464014","040138172004000","040138171002001","040138169001041","040138169001040","040138171004000","040138171002027","040138176001081","040138171002002","040138170002011","040138176001079","040138176001087","040138171002017","040138170002015","040138172001030","040138171003030","040138171003017","040138176001097","040138170002008","040138169001046","040139806001003","040134226464000","040139806001004","040138172001001","040138168001047","040135228001001","040138169002016","040138169002063","040138172002000","040138172003003","040138172004001","040138172003005","040138169001059","040138171004002","04013816
